    [],nt"revision_timestamp": "2014-09-02T23:00:36.302431",nt"name": "sim2012-3213-bathymetric-contours-of-breckenridge-reservoir-quantico-virginia",nt"isopen":
    false,nt"url": null,nt"notes": "Bathymetric data were collected using a
    boat-mounted Wide Area Augmentation System (WAAS), a type of differential global
    positioning system, echo depth-sounding equipment, and computer software. Data were
    exported into a geographic information system and converted into a point layer.
    These data points were used to create a triangulated irregular network (TIN) from
    which 2-foot contours were created. The contours were then clipped with a manually
    digitized outline of the reservoir shoreline and edited for errors. The resulting
    data was used for mapping purposes and for calculating area and volume statistics.",nt"license_title":
